    return (
        <div className="flex h-screen bg-gray-100 font-sans">
            <Sidebar />
            <div className="flex flex-col flex-1 pl-16">
                <Navbar />
                <div className="p-4">
                    <DashboardContent />
                    <Outlet /> {/* Тут відображатиметься HomePage, AnalyticsPage, etc */}
                </div>
            </div>
        </div>
    );
}
